import React from "react";

const ThankYou = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "100px", fontFamily: "Arial, sans-serif" }}>
      <h1>Hvala na narudžbi!</h1>
      <p>Vaša porudžbina je zaprimljena i uskoro će biti obrađena.</p>
    </div>
  );
};

export default ThankYou;
